import { BrowserRouter as Router, Routes, Link } from 'react-router-dom';
import HomePage from './pages/home/homePage';
import SigninPage from './pages/auth/signinPage';
import LoginPage from './pages/auth/loginPage';
import VisitorPage from './pages/income/visitorPage';
import AuthorizedPersonnelPage from './pages/income/authorizedPersonelPage';
import CredencialPage from './pages/credential/credencialPage';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="./pages/home/homePage">Home</Link>
            </li>
            <li>
              <Link to="/signin">Sign In</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/visitor">Visitor</Link>
            </li>
            <li>
              <Link to="/authorized">Authorized Personnel</Link>
            </li>
            <li>
              <Link to="/credential">Credential</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
 renders the first one that matches the current URL. */}
        <Routes path="/pages/home" exact component={HomePage} />
        <Routes path="/signin" component={SigninPage} />
        <Routes path="/login" component={LoginPage} />
        <Routes path="/visitor" component={VisitorPage} />
        <Routes path="/authorized" component={AuthorizedPersonnelPage} />
        <Routes path="/credential" component={CredencialPage} />
      </div>
    </Router>
  );
}

export default App;
